import ReactDOM from 'react-dom';
import './index.css';
import React, { Component } from 'react';

class ItemParent extends Component {
  constructor(props, context) {
    super(props, context);
    this.state = {
      numTries: 0,
      sucTries: 0,
      overlaps: false,
    };
  }

}
